import React, { useState } from 'react';
import { BrowserRouter as Router, Route, Routes, Link, Outlet, useNavigate } from 'react-router-dom';
import Page from './Page';


// Komponent strony XD
function XDPage() {
    return (
        <div>
            <h2>XD</h2>
        </div>
    );
}

// Komponent strony głównej (Home)
function Home() {
    return (
        <div>
            <Link to="/xd">Przejdź do XD</Link>
        </div>
    );
}

function App() {
    return (
        <Router>
            <Routes>
                <Route path="/" element={<Home />} />
                <Route path="/xd/*" element={<XDPage />} />
            </Routes>
        </Router>
    );
}


export default App;
